import React, { useState } from "react";
import table from "../dashboard/component/data/tabledata.json";
import "./DataSearch.css";

const DataSearch = () => {
  const [searchdata, setSearchData] = useState("");

  return (
    <div>
      <div className="data-search">
        <div className="data-search__input">
          <input
            type="text"
            placeholder="Search Data by ICAO.........."
            onChange={(event) => {
              setSearchData(event.target.value);
            }}
          />
           </div>
          {/* <button><i class="bi bi-search"></i></button> */}

          {table.filter((val)=>{
            if (searchdata == ""){
              return val
            } else if (val.icao24.toLowerCase().includes(searchdata.toLowerCase())){
              return val
            }
          }).map((val, key) => {
            return (
              <div className="data-show" key={key}>
              <ul>
                <li><span>ID:</span> {val.id}</li>
                <li><span>ICAO:</span> {val.icao24}</li>
                <li><span>Registration:</span> {val.registration}</li>
                <li><span>Manufacturer Icao:</span> {val.manufacturericao}</li>
                <li><span>Manufacturer Name:</span> {val.manufacturername}</li>
                <li><span>Model:</span> {val.model}</li>
                <li><span>Type Code:</span> {val.typecode}</li>
                <li><span>Serial Number:</span> {val.serialnumber}</li>
                <li><span>Line Number:</span> {val.linenumber}</li>
                <li><span>Icao Aircraft Type:</span> {val.icaoaircrafttype}</li>
                <li><span>Operator:</span> {val.operator}</li>
                <li><span>Operator Callsign:</span> {val.operatorcallsign}</li>
                <li><span>Operator Icao:</span> {val.operatoricao}</li>
                <li><span>Operator Iata:</span> {val.operatoriata}</li>
                <li><span>Owner:</span> {val.owner}</li>
                <li><span>Test Reg:</span> {val.testreg}</li>
                <li><span>Registered:</span> {val.registered}</li>
                <li><span>Reguntil:</span> {val.reguntil}</li>
                <li><span>Built:</span> {val.built}</li>
                <li><span>First Flight Date:</span> {val.firstflightdate}</li>
                <li><span>Seat Configuration:</span> {val.seatconfiguration}</li>
                <li><span>Engines:</span> {val.engines}</li>
                <li><span>Modes:</span> {val.modes}</li>
                <li><span>Adsb:</span> {val.adsb}</li>
                <li><span>Acars:</span> {val.acars}</li>
                <li><span>Notes:</span> {val.notes}</li>
                <li><span>Category Description:</span> {val.categorydescription}</li>
                <li><span>Status:</span> {val.status}</li>
                <li><span>Matched:</span> {val.matched}</li>
              </ul>
              </div>
            );
          })}

      </div>
    </div>
  );
};

export default DataSearch;
